import React from "react";
import TypeIt from "typeit-react";

const Home= () => {
  return (
    <div>
      <h1 className="Home">
        <TypeIt
          getBeforeInit={(instance) => {
            instance
              .type("Nvver", { delay: 300 })
              .move(-3)
              .delete(1)
              .type("e")
              .move("END")
              .type(" let yees")
              .pause(300)
              .delete(2)
              .type("sterday use up to muc")
              .move(-4)
              .type("o")
              .move("END")
              .type("h of today.")
              .pause(500)
              .break({ delay: 500 })
              .break({ delay: 500 })
              .type("<em>- Will Rogers</em>")
              .go();
            // Remember to return it!
            return instance;
          }}
        />
        ;
      </h1>
    </div>
  );
};

export default Home;
